import React from "react";
import styled from 'styled-components';

const Navbar = () => {

  return <>
    <Nav>
      <h1>Park Games</h1>
      <h2>Home</h2>

    </Nav>

  </>

}

export default Navbar;

const Nav = styled.nav`
background: white;

h1 {
  text-align: center;
}



`
